Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      _parent.移动("右",慢速度);
   }
   else if(_parent.方向 == "左")
   {
      _parent.移动("左",慢速度);
   }
}
gotoAndPlay(_parent.近战招式);

function 射击(){
	var itemData = _root.getItemData(_parent.手枪).data;
	var 子弹属性 = _root.子弹属性初始化(this.攻击点);

	子弹属性.声音 = itemData.sound;
	子弹属性.霰弹值 = 2;
	子弹属性.子弹散射度 = itemData.diffusion;
	子弹属性.发射效果 = "";
	子弹属性.子弹种类 = "横向联弹-" + itemData.bullet;
	子弹属性.子弹威力 = _parent.手枪威力表[_parent.手枪];
	子弹属性.子弹速度 = 30;
	子弹属性.Z轴攻击范围 = 25;
	子弹属性.击倒率 = 50;

	_root.子弹区域shoot传递(子弹属性);
}

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
